  \"channel-islands-kelp-forest-monitoring-survey-5m-quadrat\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"This dataset from the Channel Islands National Park's Kelp
  Forest Monitoring Program has measurements of the abundance of selected rare, clumped,
  sedentary indicator species. The summary data presented here represents the mean
  density per square meter. Sampling is conducted annually between the months of May-October,
  so the Time data in this file is July 1 of each year (a nominal value). The original
  measurements were taken at various depths, so the Depth data in this file is the
  depth of the station's temperature logger, which is a typical depth.\",\n\t\"license_title\":
